	/**
	 * Get Color for event name
	 * @param eventName
	 * @return new Color(r,g,b)
	 */
	public static Color getColor(String eventName){
		if (seriesNameColor.containsKey(eventName)){
			return seriesNameColor.get(eventName);
		} else {
			return new Color(100,100,100);
		}
	}
	

